1	Tìm hiểu về đặc điểm Cộng đồng hỗ trợ	Tại sao chọn tương hỗ?	[{"title": "Ngày càng có nhiều người mắc bệnh hiểm nghèo", "sub_content": "Năm 2020, Việt Nam xếp vị trí 90/185 quốc gia vùng lãnh thổ, với tỷ lệ mắc ung thư là 159,7/100.000 dân, xếp thứ 16 châu Á và đứng thứ 6 tại Đông Nam Á. Theo thống kê của Tổ chức y tế thế giới (WHO), số ca mắc mới ung thư tại Việt Nam không ngừng tăng, từ 68.000 ca năm 2000 lên 126.000 ca năm 2010. Năm 2018, số ca mắc mới tăng lên gần 165.000 ca/86,5 triệu dân. Đến năm 2020, Việt Nam ghi nhận hơn 182.500 ca mới, 122.690 ca tử vong trên tổng số 97,3 triệu dân. Cả nước đang còn 353.000 bệnh nhân sống chung với ung thư."}, {"title": "Không phải ai cũng có thể tham gia bảo hiểm nhân thọ, bảo hiểm sức khỏe", "sub_content": "Không phải ai có nhu cầu cũng có thể tham gia bảo hiểm nhân thọ, sức khỏe bởi khi tham gia phải đáp ứng điều kiện. Những người đã có bệnh từ trước sẽ không được mua bảo hiểm hoặc có những ngành nghề không nằm trong nhóm đối tượng được bảo hiểm."}, {"title": "Các sản phẩm với chi phí thấp", "sub_content": "Những nền tảng hỗ trợ này đặc trưng với mô hình tương trợ “một người ốm, mọi người cùng chia sẻ”. Tức là mạng lưới hỗ trợ tương đương với việc xây dựng một nhóm người dùng, tập hợp sức mạnh của tất cả mọi người và giúp các thành viên ốm yếu vượt qua khó khăn. Nếu một thành viên mắc bệnh hiểm nghèo hoặc gặp rủi ro trong cuộc sống, những người khác sẽ chia sẻ tiền hỗ trợ, tương tự, nếu bạn không may gặp phải rủi ro, bạn cũng có thể nhận được khoản hỗ trợ tương ứng. Mạng lưới hỗ trợ lẫn nhau không có đại lý trung gian và liên kết bán hàng, tỷ lệ phí quản lý thấp khoảng 8-10% số tiền hỗ trợ, nếu số lượng người tham gia càng lớn số tiền phân chia sẽ càng nhỏ. Do đó, khi tham gia vào nền tảng hỗ trợ, các chi phí bạn bỏ ra để tham gia các sản phẩm là rất thấp."}, {"title": "Sản phẩm chỉ có chức năng bảo vệ", "sub_content": "Những sản phẩm nền tảng tương hỗ này áp dụng không phải là sản phẩm bảo hiểm, chúng chỉ có chức năng bảo vệ, không sử dụng vào mục đích tiết kiệm và đầu tư. Mọi người trong cộng đồng sẽ cùng chung tay đóng góp để hỗ trợ các thành viên gặp rủi ro trong cuộc sống. Thủ tục tham gia sản phẩm, quá trình yêu cầu bồi thường, khiếu nại đều nhanh chóng và đơn giản hơn rất nhiều so với tham gia sản phẩm của doanh nghiệp bảo hiểm."}, {"title": "Thời gian tham gia linh hoạt", "sub_content": "Khác với các sản phẩm bảo hiểm nhân thọ, bạn có thể tham gia nền tảng tương hỗ và tự nguyện chấm dứt việc tham gia vào bất cứ lúc nào, bất cứ giai đoạn nào nếu đảm bảo nghĩa vụ tài chính. Điểm đặc biệt cần lưu ý đối với mô hình tương hỗ này là các thành viên chỉ được hỗ trợ duy nhất 01 lần đối với 01 chương trình. Sau khi nhận được tiền hỗ trợ, tư cách thành viên chỉ được duy trì để thực hiện phân chia tiền hỗ trợ cho các thành viên, không được tham gia các chương trình hỗ trợ khác."}, {"title": "Dành cho cả phân khúc khách hàng lớn tuổi, có bệnh nền, thu nhập thấp", "sub_content": "Nếu những khách hàng lớn tuổi, có bệnh nền hoặc thu nhập thấp gặp khó khăn trong việc tham gia sản phẩm bảo hiểm, thì nền tảng hỗ trợ lẫn nhau chính là giải pháp giúp họ có thể được bảo vệ trước những rủi ro xảy ra trong cuộc sống. Sẽ có những chương trình hỗ trợ bệnh ung thư, bệnh hiểm nghèo dành cho người cao tuổi, người mắc bệnh mãn tính. Đối với những người có thu nhập thấp, đây không còn là mối lo đối với họ vì họ chỉ phải bỏ ra một khoản chi phí rất thấp đã có thể tham gia nền tảng hỗ trợ này."}]	\N	\N
2	Quy trình hoạt động của Cộng đồng hỗ trợ	Quy trình hỗ trợ?	[{"title": "", "sub_content": "<p class=\\"\\"><b>B&#432;&#7899;c 1: Ho&#224;n thi&#7879;n h&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907;</b><br>Khi th&#224;nh vi&#234;n c&#7911;a ch&#432;&#417;ng tr&#236;nh g&#7863;p kh&#243; kh&#259;n n&#7897;p h&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907; ph&#249; h&#7907;p v&#7899;i c&#225;c &#273;i&#7873;u kho&#7843;n v&#224; &#273;i&#7873;u ki&#7879;n c&#7911;a ch&#432;&#417;ng tr&#236;nh. Trong qu&#225; tr&#236;nh ho&#224;n thi&#7879;n h&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907;, th&#224;nh vi&#234;n c&#243; th&#7875; nh&#7901; s&#7921; gi&#250;p &#273;&#7905; c&#7911;a th&#224;nh vi&#234;n h&#7895; tr&#7907;. H&#7891; s&#417; c&#7909; th&#7875; s&#7869; &#273;&#432;&#7907;c quy &#273;&#7883;nh &#7903; t&#7915;ng ch&#432;&#417;ng tr&#236;nh.<br>Th&#224;nh vi&#234;n h&#7895; tr&#7907;: L&#224; th&#224;nh vi&#234;n c&#7911;a ch&#432;&#417;ng tr&#236;nh v&#224; t&#7921; nguy&#7879;n h&#7895; tr&#7907; th&#224;nh vi&#234;n kh&#225;c trong qu&#225; tr&#236;nh thu th&#7853;p h&#7891; s&#417;, gi&#7845;y t&#7901; v&#224; ho&#224;n thi&#7879;n th&#7911; t&#7909;c c&#7847;n thi&#7871;t &#273;&#7875; nh&#7853;n &#273;&#432;&#7907;c s&#7921; h&#7895; tr&#7907; t&#7915; c&#7897;ng &#273;&#7891;ng. Th&#224;nh vi&#234;n h&#7895; tr&#7907; ph&#7843;i &#273;&#225;p &#7913;ng c&#225;c y&#234;u c&#7847;u nh&#7845;t &#273;&#7883;nh v&#224; &#273;&#432;&#7907;c c&#7897;ng &#273;&#7891;ng th&#224;nh vi&#234;n t&#237;n nhi&#7879;m v&#224; b&#236;nh ch&#7885;n, &#273;&#432;&#7907;c nh&#7853;n th&#249; lao theo th&#7887;a thu&#7853;n khi ho&#224;n th&#224;nh c&#244;ng vi&#7879;c.</p><p class=\\"\\"><b>B&#432;&#7899;c 2: X&#225;c minh th&#244;ng tin y&#234;u c&#7847;u h&#7895; tr&#7907; th&#244;ng qua Th&#224;nh vi&#234;n gi&#225;m s&#225;t</b><br>Sau khi h&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907; &#273;&#432;&#7907;c g&#7917;i v&#7873; s&#7869; tr&#7843;i qua b&#432;&#7899;c x&#225;c minh t&#237;nh ch&#237;nh x&#225;c, trung th&#7921;c c&#7911;a h&#7891; s&#417; c&#361;ng nh&#432; xem x&#233;t h&#7891; s&#417; c&#243; ph&#249; h&#7907;p v&#7899;i c&#225;c y&#234;u c&#7847;u v&#224; &#273;i&#7873;u ki&#7879;n c&#7911;a ch&#432;&#417;ng tr&#236;nh m&#224; ng&#432;&#7901;i &#273;&#243; tham gia hay kh&#244;ng th&#244;ng qua Th&#224;nh vi&#234;n gi&#225;m s&#225;t.<br>Th&#224;nh vi&#234;n gi&#225;m s&#225;t: L&#224; th&#224;nh vi&#234;n c&#7911;a ch&#432;&#417;ng tr&#236;nh v&#224; &#273;&#432;&#7907;c giao nhi&#7879;m v&#7909; &#273;i x&#225;c minh th&#244;ng tin, ki&#7875;m tra, r&#224; so&#225;t, &#273;&#225;nh gi&#225; v&#7909; vi&#7879;c &#273;&#7875; &#273;&#7873; xu&#7845;t c&#7897;ng &#273;&#7891;ng c&#243; ch&#7845;p nh&#7853;n h&#7895; tr&#7907; hay kh&#244;ng.<br>Th&#224;nh vi&#234;n gi&#225;m s&#225;t ph&#7843;i c&#243; ti&#234;u chu&#7849;n nh&#7845;t &#273;&#7883;nh v&#224; &#273;&#432;&#7907;c m&#7897;t s&#7889; l&#432;&#7907;ng nh&#7845;t &#273;&#7883;nh th&#224;nh vi&#234;n c&#7897;ng &#273;&#7891;ng b&#236;nh ch&#7885;n. Th&#224;nh vi&#234;n gi&#225;m s&#225;t &#273;&#432;&#7907;c nh&#7853;n th&#249; lao theo tho&#7843; thu&#7853;n khi th&#7921;c hi&#7879;n c&#244;ng vi&#7879;c &#273;&#432;&#7907;c giao.</p><p class=\\"\\"><b>B&#432;&#7899;c 3: X&#225;c minh th&#244;ng tin y&#234;u c&#7847;u h&#7895; tr&#7907; th&#244;ng qua Vics-corp</b><br>Sau khi h&#7891; s&#417; &#273;&#432;&#7907;c ho&#224;n thi&#7879;n v&#224; &#273;&#432;&#7907;c x&#225;c minh b&#7903;i th&#224;nh vi&#234;n gi&#225;m s&#225;t, h&#7891; s&#417; c&#7911;a ng&#432;&#7901;i y&#234;u c&#7847;u h&#7895; tr&#7907; c&#242;n ph&#7843;i tr&#7843;i qua b&#432;&#7899;c x&#225;c minh c&#7911;a c&#244;ng ty C&#7893; ph&#7847;n T&#432; v&#7845;n D&#7883;ch v&#7909; B&#7843;o hi&#7875;m Vi&#7879;t Nam &#273;&#7875; &#273;&#7843;m b&#7843;o t&#237;nh kh&#225;ch quan c&#7911;a t&#7915;ng h&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907;.</p><p class=\\"\\"><b>B&#432;&#7899;c 4. Nh&#7853;n ti&#7873;n h&#7895; tr&#7907;</b><br>N&#7871;u h&#7891; s&#417; c&#7911;a th&#224;nh vi&#234;n &#273;&#7841;t &#273;&#432;&#7907;c c&#225;c ti&#234;u chu&#7849;n v&#224; &#273;i&#7873;u ki&#7879;n c&#7911;a ch&#432;&#417;ng tr&#236;nh, th&#224;nh vi&#234;n s&#7869; nh&#7853;n &#273;&#432;&#7907;c kho&#7843;n ti&#7873;n h&#7895; tr&#7907; c&#7911;a C&#7897;ng &#273;&#7891;ng h&#7895; tr&#7907; v&#224;o ng&#224;y ph&#226;n chia c&#7911;a th&#225;ng.<br>Ngo&#224;i ra, quy&#7871;t &#273;&#7883;nh c&#7911;a c&#225;c th&#224;nh vi&#234;n trong C&#7897;ng &#273;&#7891;ng h&#7895; tr&#7907; l&#224; r&#7845;t quan tr&#7885;ng.<br>Khi c&#243; tranh ch&#7845;p trong qu&#225; tr&#236;nh gi&#7843;i quy&#7871;t H&#7891; s&#417; y&#234;u c&#7847;u h&#7895; tr&#7907; C&#7897;ng &#273;&#7891;ng h&#7895; tr&#7907; s&#7869; t&#7893; ch&#7913;c cu&#7897;c kh&#7843;o s&#225;t l&#7845;y &#253; ki&#7871;n t&#7915; c&#225;c th&#224;nh vi&#234;n, k&#7871;t qu&#7843; kh&#7843;o s&#225;t s&#7869; l&#224; k&#7871;t qu&#7843; cu&#7889;i c&#249;ng &#273;&#7875; s&#7917; d&#7909;ng gi&#7843;i quy&#7871;t tranh ch&#7845;p.<br>Cu&#7889;i m&#7895;i n&#259;m s&#7869; c&#243; b&#225;o c&#225;o, t&#7893;ng h&#7907;p c&#244;ng vi&#7879;c v&#224; &#273;&#7883;nh h&#432;&#7899;ng ph&#225;t tri&#7875;n ti&#7871;p theo &#273;&#7875; g&#7917;i &#273;&#7871;n c&#225;c th&#224;nh vi&#234;n c&#7897;ng &#273;&#7891;ng quy&#7871;t &#273;&#7883;nh.<br>Nguy&#234;n t&#7855;c bi&#7875;u quy&#7871;t s&#7869; &#273;&#432;&#7907;c quy &#273;&#7883;nh tu&#7923; t&#7915;ng th&#7901;i &#273;i&#7875;m c&#7909; th&#7875;.</p>"}]	\N	\N
