3	Cộng đồng hỗ trợ	Năm 2020, Việt Nam xếp vị trí 90/185 quốc gia vùng lãnh thổ, với tỷ lệ mắc ung thư là 159,7/100.000 dân, xếp thứ 16 châu Á và đứng thứ 6 tại Đông Nam Á. Theo thống kê của Tổ chức y tế thế giới (WHO), số ca mắc mới ung thư tại Việt Nam không ngừng tăng, từ 68.000 ca năm 2000 lên 126.000 ca năm 2010. Năm 2018, số ca mắc mới tăng lên gần 165.000 ca/86,5 triệu dân. Đến năm 2020, Việt Nam ghi nhận hơn 182.500 ca mới, 122.690 ca tử vong trên tổng số 97,3 triệu dân. Cả nước đang còn 353.000 bệnh nhân sống chung với ung thư. Những nền tảng hỗ trợ này đặc trưng với mô hình tương trợ “một người ốm, mọi người cùng chia sẻ”. Tức là mạng lưới hỗ trợ tương đương với việc xây dựng một nhóm người dùng, tập hợp sức mạnh của tất cả mọi người và giúp các thành viên ốm yếu vượt qua khó khăn. Nếu một thành viên mắc bệnh hiểm nghèo hoặc gặp rủi ro trong cuộc sống, những người khác sẽ chia sẻ tiền hỗ trợ, tương tự, nếu bạn không may gặp phải rủi ro, bạn cũng có thể nhận được khoản hỗ trợ tương ứng. Mạng lưới hỗ trợ lẫn nhau không có đại lý trung gian và liên kết bán hàng, tỷ lệ phí quản lý thấp khoảng 8-10% số tiền hỗ trợ, nếu số lượng người tham gia càng lớn số tiền phân chia sẽ càng nhỏ. Do đó, khi tham gia vào nền tảng hỗ trợ, các chi phí bạn bỏ ra để tham gia các sản phẩm là rất thấp.	<strong>Lorem Ipsum</strong><span>&#160;is simply dummy text of the p</span><img src="data:image/webp;base64,"><span>rinting and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s</span>	news/news-1649062076_27496525.jpg	2021-12-13 07:48:45	2022-05-17 14:40:46	2022-05-17 14:40:46
