4	CHƯƠNG TRÌNH HỖ TRỢ CHO NGƯỜI BỊ TAI NẠN GIAO THÔNG	Trong những năm qua con số về tình hình tai nạn giao thông ở nước ta rất báo động. Trong số đó, những vụ tai nạn xảy ra gây tổn thất lên đến hàng trăm triệu đồng chiếm đến 70%.\nVới tình hình giao thông phức tạp tại Việt Nam và chi phí y tế đắt đỏ, việc chỉ có bảo hiểm y tế hay bảo hiểm xe máy là chưa đủ để bảo vệ trọn vẹn cho bản thân. Do đó, để góp phần góp phần khắc phục những hạn chế trên, giúp giảm bớt rủi ro và đem lại sự yên tâm cho bạn. Chương trình Hỗ trợ tai nạn giao thông được xây dựng với mục đích cộng đồng có thể chung tay chia sẻ phần nào khó khăn về tài chính đối với những người không may mắn bị tai nạn giao thông. Trong trường hợp người tham gia chương trình không may mất mạng, toàn bộ số tiền vẫn được trao trả cho những người có liên quan hoặc thụ hưởng	Độ tuổi tham gia: từ 30 ngày tuổi - 59 tuổi	Các thành viên qua đời hoặc bị tàn tật vì những lý do hoặc hoàn cảnh sau đây sẽ không thể nhận được sự hỗ trợ lẫn nhau:\n(1) Thành viên trả tiền cho người khác để cố ý làm bản thân bị thương\n(2) Đánh nhau, ẩu đả, hành hung hoặc tử vong do hành vi khiêu khích hoặc cố ý của các thành viên;\n(3) Thành viên mang thai (bao gồm thai ngoài tử cung), sảy thai (nhưng sảy thai không phải do tai nạn thương tích), sinh con, bệnh tật, dị ứng thuốc,ngộ độc thực phẩm, đột tử;\n(4) Tai nạn do các thành viên trải qua phẫu thuật hoặc các hoạt động y tế khác\n(5) Uống, bôi hoặc tiêm thuốc một cách tự ý mà không theo hướng dẫn của bác sĩ;\n(6) Tai nạn do các thành viên mất trí, mất trật tự hoặc say rượu.\n(7) Thành viên bị nhiễm vi khuẩn, vi rút hoặc ký sinh trùng (trừ trường hợp nhiễm trùng vết thương do tai nạn thương tích)\n(8) Nổ, cháy, ô nhiễm hoặc bức xạ gây ra bởi bất kỳ vũ khí sinh học, hóa học, năng lượng nguyên tử, hoặc thiết bị năng lượng hạt nhân nào\n(9) Hành vi phạm tội hoặc chống lại việc bắt giữ;\n(10) Hành vi vi phạm nghiêm trọng các quy định của hãng vận chuyển về việc đi xe an toàn. \n\nCác thành viên bị khuyết tật và bị tử vong do tai nạn trong những thời gian sau sẽ không thể nhận được sự hỗ trợ:\n(1) Trong chiến tranh, hoạt động quân sự, bạo loạn hoặc nổi dậy vũ trang;\n(2) Tham gia vào các hoạt động phạm pháp, tội phạm hoặc bị giam giữ, chấp hành án theo quy định của pháp luật;\n(3) Bị ảnh hưởng bởi ma túy và bị ma túy được kiểm soát\n(4) Không tham gia bất kỳ phương tiện giao thông nào với tư cách là hành khách\n(5) Rời khỏi địa điểm điều hành của phương tiện đang vận hành trong chuyến bay, tàu hỏa hoặc đường sắt và trong thời gian thành viên rời khỏi phương tiện điều hành giữa chừng khi đi xe khách.	Thành viên của chương trình bị tai nạn khi tham gia giao thông hợp pháp, quỹ hỗ trợ có thể hỗ trợ tối đa 200 triệu đồng/người/vụ tai nạn.\nTùy theo mức độ thương tật của các thành viên trong vụ tai nạn, các thành viên có thể yêu cầu theo tỷ lệ tương ứng như sau:\n- Người khuyết tật đặc biệt nặng khi được Hội đồng giám định y khoa kết luận không còn khả năng tự phục vụ hoặc suy giảm khả năng lao động từ 81% trở lên;\n- Người khuyết tật nặng khi được Hội đồng giám định y khoa kết luận có khả năng tự phục vụ sinh hoạt nếu có người, phương tiện trợ giúp một phần hoặc suy giảm khả năng lao động từ 61% đến 80%;\n- Người khuyết tật nhẹ khi được Hội đồng giám định y khoa kết luận có khả năng tự phục vụ sinh hoạt hoặc suy giảm khả năng lao động dưới 61%.	Trường hợp nếu có người bị bệnh yêu cầu hỗ trợ thì sẽ áp dụng công thức sau:\n(Tổng số tiền mà thành viên đó đăng ký hỗ trợ + Phí quản lý - Số dư kỳ trước)/ Tổng số người của dự án	Không áp dụng thời gian chờ đối với thành viên tham gia chương trình hỗ trợ này.	1	2021-12-13 08:38:46	2022-05-10 14:58:27	\N	2021-01-01	2021-12-31	CHƯƠNG TRÌNH HỖ TRỢ CHO NGƯỜI BỊ TAI NẠN GIAO THÔNG	Mỗi thành viên khi tham gia sẽ phải đảm bảo duy trì tài khoản tối thiểu là 100.000 VNĐ/người.	\N
1	CHƯƠNG TRÌNH HỖ TRỢ UNG THƯ CHO NGƯỜI MẮC BỆNH MÃN TÍNH	Chương trình Hỗ trợ ung thư cho người mắc bệnh mãn tính được xây dựng nhằm hướng đến những người đang mắc các bệnh mãn tính nhưng vẫn muốn được tham gia bảo vệ trước rủi ro trong cuộc sống chỉ với mức chi phí thấp. Cộng đồng tham gia chương trình sẽ chung tay chia sẻ phần nào khó khăn về tài chính đối với những thành viên không may mắn, đồng thời tạo động lực cho họ có thể vững tâm hơn trên bước đường cuộc sống.	- Độ tuổi tham gia:  Từ 06 tuổi đến đủ 59 tuổi.\n- Đối tượng tham gia: Những người đang mắc một trong các bệnh mãn tính như: huyết áp cao, máu nhiễm mỡ, viêm khớp, tiểu đường, … đều có thể tham gia chương trình.	Trong quá trình tham gia trương trình, thành viên nào thuộc các trường hợp dưới đây, sẽ không thể nhận được sự hỗ trợ từ chương trình:\nNếu thành viên bị chẩn đoán có khối u ác tính không thuộc phạm vi hỗ trợ quy định tại mục 6.1 và thuộc một trong những trường hợp sau đây, thành viên đó sẽ không thể nhận được hỗ trợ từ chương trình. Tư cách thành viên sẽ bị chấm dứt và thành viên đó sẽ phải tự động rút khỏi chương trình mà không được hoàn lại số tiền hỗ trợ đã chia sẻ trước đó:\n Hành vi gian lận của thành viên như làm giả giấy tờ, hồ sơ bệnh án, kê khai không trung thực…;\n Thành viên đã sử dụng hoặc chịu tác động của việc sử dụng ma túy hoặc những chất gây nghiện khác, trừ khi các chất này được sử dụng theo chỉ định của bác sĩ;\n Thành viên mắc phải Hội chứng suy giảm hệ miễn dịch mắc phải (AIDS), bệnh liên quan đến AIDS hoặc nhiễm vi rút gây suy giảm miễn dịch ở người (HIV), trừ trường hợp được xác định nhiễm HIV do truyền máu hoặc do nghề nghiệp.\n Có bệnh di truyền , dị tật bẩm sinh, dị tật hoặc có nhiễm sắc thể bất thường.	Dựa vào các nhóm tuổi khác nhau, những thành viên tham gia chương trình này sẽ nhận được khoản tiền hỗ trợ tối đa khác nhau theo bảng dưới đây:\nĐộ tuổi: \n- Từ 6 tuổi - đủ 18 tuổi: 300.000.000 đồng\n- Từ 19 tuổi - đủ 25 tuổi: 280.000.000 đồng\n- Từ 26 tuổi - đủ 35 tuổi: 260.000.000 đồng\n- Từ 36 tuổi - đủ 45 tuổi: 240.000.000 đồng\n- Từ 46 tuổi - đủ 55 tuổi: 220.000.000 đồng\n- Từ 56 tuổi - 59 tuổi: 200.000.000 đồng\nMỗi thành viên chỉ được tham gia chương trình hỗ trợ này và được nhận hỗ trợ 01 (một) lần trong suốt quá trình tham gia. Các thành viên chia sẻ số tiền hỗ trợ theo hình thức quyên góp và số tiền đã được phân chia để hỗ trợ sẽ không thể thu lại.	Cách tính tiền phân chia trong mỗi kỳ:\n Trường hợp nếu có người bị bệnh yêu cầu hỗ trợ thì sẽ áp dụng công thức sau:\n(Tổng số tiền mà thành viên đó đăng ký hỗ trợ + Phí quản lý)/ Tổng số người của dự án	Thời gian chờ sẽ diễn ra trong vòng 90 ngày (bao gồm cả ngày thứ 90) bắt đầu từ 0h00 ngày tiếp theo kể từ khi thành viên tham gia chương trình.	1	2021-12-13 07:50:35	2022-05-06 09:26:59	\N	2021-12-01	2021-12-31	CHƯƠNG TRÌNH HỖ TRỢ UNG THƯ CHO NGƯỜI MẮC BỆNH MÃN TÍNH	Mỗi thành viên khi tham gia sẽ phải duy trì số tiền trong tài khoản tối thiểu là 100.000 VNĐ/người.	\N
2	CHƯƠNG TRÌNH HỖ TRỢ BỆNH HIỂM NGHÈO	Theo thống kê của Tổ chức y tế Thế giới thì mỗi năm Việt Nam có đến 73% trường hợp tử vong do các căn bệnh không lây nhiễm như Ung thư, tim mạch, phổi mãn tính, tiểu đường… Đối với các bệnh này chi phí chữa trị là vô cùng lớn ngay cả trong giai đoạn đầu phát hiện bệnh. Các căn bệnh hiểm nghèo là nguyên nhân trực tiếp đưa những gia đình có cuộc sống yên bình lâm vào cảnh nợ nần, khó khăn về tài chính khi phải xoay sở chữa bệnh cho người thân vì chi phí chữa bệnh quá lớn trong một thời gian ngắn. Để hỗ trợ phần nào cho những gia đình không may có người mắc bệnh hiểm nghèo Cộng đồng hỗ trợ đã xây dựng chương trình hỗ trợ bệnh hiểm nghèo nhằm tìm sự chia sẻ của cộng đồng cho những người không may mắc bệnh.	Để tham gia chương trình này các thành viên phải đạt từ 06 tuổi đến đủ 59 tuổi và đáp ứng các tiêu chuẩn về sức khỏe.	Trong quá trình tham gia chương trình, thành viên nào thuộc các trường hợp dưới đây, sẽ không thể nhận được sự hỗ trợ từ chương trình.\nNếu thành viên bị chẩn đoán mắc một trong 155 bệnh quy định của Cộng đồng trong thời gian chờ thì thành viên đó sẽ không thể nhận được hỗ trợ từ chương trình. Tuy nhiên tư cách thành viên sẽ không bị mất đi, thành viên đó vẫn có thể tham gia hỗ trợ cho những thành viên khác không may mắc bệnh. Trường hợp thành viên đó rút khỏi chương trình sẽ không được hoàn lại số tiền hỗ trợ đã chia sẻ trước đó;\nHành vi gian lận của thành viên như làm giả giấy tờ, hồ sơ bệnh án, kê khai không trung thực;\nKhông cung cấp đầy đủ hồ sơ yêu cầu hỗ trợ theo quy định và trong thời hạn quy định;\nThành viên đã sử dụng hoặc chịu tác động của việc sử dụng ma túy hoặc những chất gây nghiện khác, trừ khi các chất này được sử dụng theo chỉ định của bác sĩ;\nThành viên mắc phải Hội chứng suy giảm hệ miễn dịch mắc phải (AIDS), bệnh liên quan đến AIDS hoặc nhiễm vi rút gây suy giảm miễn dịch ở người (HIV), trừ trường hợp được xác định nhiễm HIV do truyền máu hoặc do tai nạn nghề nghiệp.\nCác bệnh di truyền, dị tật bẩm sinh, dị tật hoặc có nhiễm sắc thể bất thường.	Dựa vào độ tuổi được bảo vệ khác nhau, các thành viên tham gia chương trình sẽ nhận được số tiền hỗ trợ tương ứng:\n- Từ 06 tuổi - đủ 18 tuổi: 500.000.000 đồng\n- Từ 19 tuổi - đủ 20 tuổi: 480.000.000 đồng\n- Từ 21 tuổi - đủ 25 tuổi: 460.000.000 đồng\n- Từ 26 tuổi - đủ 30 tuổi: 440.000.000 đồng\n- Từ 31 tuổi - đủ 35 tuổi: 420.000.000 đồng\n- Từ 36 tuổi - đủ 40 tuổi: 400.000.000 đồng\n- Từ 41 tuổi - đủ 45 tuổi: 380.000.000 đồng\n- Từ 46 tuổi - đủ 50 tuổi: 360.000.000 đồng\n- Từ 51 tuổi - đủ 55 tuổi: 340.000.000 đồng\n- Từ 56 tuổi -  đủ 59 tuổi: 320.000.000 đồng\nMỗi thành viên tham gia chương trình hỗ trợ này chỉ được nhận hỗ trợ 01 (một) lần trong suốt quá trình tham gia. Các thành viên chia sẻ số tiền hỗ trợ theo hình thức quyên góp và số tiền đã được phân chia để hỗ trợ sẽ không thể thu lại.	Cách phân chia tiền hỗ trợ trong mỗi kỳ, trường hợp nếu có người bị bệnh đủ điều kiện yêu cầu hỗ trợ sẽ được áp dụng công thức tính sau:\n  (Tổng số tiền mà thành viên được hỗ trợ trong độ tuổi quy định + Phí quản lý - / Tổng số người tham gia chương trình.	Thời gian chờ sẽ diễn ra trong vòng 90 ngày (bao gồm cả ngày thứ 90) bắt đầu từ 0h00 ngày tiếp theo kể từ khi thành viên tham gia chương trình.	1	2021-12-13 08:37:13	2022-05-10 14:37:58	\N	2021-12-01	2021-12-31	CHƯƠNG TRÌNH HỖ TRỢ BỆNH HIỂM NGHÈO	Mỗi thành viên khi tham gia sẽ phải đảm bảo duy trì tài khoản tối thiểu 100.000 VNĐ/người.	\N
3	CHƯƠNG TRÌNH HỖ TRỢ BỆNH UNG THƯ CHO NGƯỜI GIÀ	Theo thống kê tính đến năm 2022 Việt Nam có khoảng hơn 08 triệu người già có độ tuổi từ 60 tuổi trở lên chiếm khoảng 8% dân số. Trong đó tỷ lệ người già mắc bệnh chiếm khoảng 95%, chủ yếu là các bệnh mãn tính không lây truyền, trung bình 01 người cao tuổi ở Việt Nam sẽ mắc 03 bệnh trong khi đó hệ thống y tế, chăm sóc sức khỏe cho người già ở Việt Nam còn nhiều hạn chế, số người cao tuổi được hưởng lương hưu và bảo hiểm y tế còn thấp dẫn đến việc khi mắc bệnh người già thường gặp khó khăn trong điều trị và trang trải cuộc sống.\nNhằm hỗ trợ một phần chi phí điều trị cũng như các chi phí trang trải cuộc sống cho những người cao tuổi không may mắc bệnh ung thu. Cộng đồng hỗ trợ đã xây dựng chương trình hỗ trợ bệnh ung thư cho người già với mục tiêu những người cao tuổi sẽ cùng chung tay hỗ trợ cho những người không may mắc bệnh và giúp đỡ họ một khoản chi phí để điều trị cũng như ổn định cuộc sống, hạn chế gánh nặng cho xã hội, người thân và gia đình.	Những người tham gia trong độ tuổi từ 60-70 tuổi không có bệnh lý nền hoặc có thể mắc một số bệnh lý nền như gan nhiễm mỡ mức độ 1, huyết áp cao, tiểu đường…	Trong quá trình tham gia chương trình, thành viên nào thuộc các trường hợp dưới đây, sẽ không thể nhận được sự hỗ trợ từ chương trình:\n(1) Nếu thành viên bị chẩn đoán mắc bệnh ung thư được Cộng đồng quy định trong thời gian chờ thì thành viên đó sẽ không thể nhận được hỗ trợ từ chương trình. Tuy nhiên tư cách thành viên sẽ không bị mất đi, thành viên đó vẫn có thể tham gia hỗ trợ cho những thành viên khác không may mắc bệnh. Trường hợp thành viên đó rút khỏi chương trình sẽ không được hoàn lại số tiền hỗ trợ đã chia sẻ trước đó;\n(2) Hành vi gian lận của thành viên như làm giả giấy tờ, hồ sơ bệnh án, kê khai không trung thực;\n(3) Không cung cấp đầy đủ hồ sơ yêu cầu hỗ trợ theo quy định và trong thời hạn quy định;\n(4) Thành viên đã sử dụng hoặc chịu tác động của việc sử dụng ma túy hoặc những chất gây nghiện khác, trừ khi các chất này được sử dụng theo chỉ định của bác sĩ;\n(5) Thành viên mắc phải Hội chứng suy giảm hệ miễn dịch mắc phải (AIDS), bệnh liên quan đến AIDS hoặc nhiễm vi rút gây suy giảm miễn dịch ở người (HIV), trừ trường hợp được xác định nhiễm HIV do truyền máu hoặc do tai nạn nghề nghiệp.\n(6) Các bệnh di truyền, dị tật bẩm sinh, dị tật hoặc có nhiễm sắc thể bất thường.	Khi tham gia cộng đồng hỗ trợ các thành viên sẽ chung tay chia sẻ khó khăn với những người già không may mắc các bệnh ung thư. Các thành viên của cộng đồng sẽ chung tay chia sẻ tiền viện phí, các chi phí khám chữa bệnh.\n- Số tiền hỗ trợ đối với người già mắc bệnh ung thư không có bệnh lý nền tối đa lên đến 300.000.000 đồng tuỳ thuộc từng độ tuổi.\n- Số tiền hỗ trợ đối với người già mắc bệnh ung thư có bệnh lý nền tối đa lên đến 200.000.000 đồng	Cách phân chia tiền hỗ trợ trong mỗi kỳ, trường hợp nếu có người bị bệnh đủ điều kiện yêu cầu hỗ trợ sẽ được áp dụng công thức tính sau:\n(Tổng số tiền mà thành viên được hỗ trợ theo độ tuổi của chương trình + Phí quản lý / Tổng số người tham gia chương trình).	Tham gia chương trình các thành viên có thời gian chờ 90 ngày trước khi được yêu cầu nhận hỗ trợ từ cộng đồng, thời gian được quyền yêu cầu hỗ trợ từ cộng đồng tính từ 00h00’ của ngày tiếp theo.	1	2021-12-13 08:38:10	2022-05-10 14:44:58	\N	2022-01-01	2022-01-31	CHƯƠNG TRÌNH HỖ TRỢ BỆNH UNG THƯ CHO NGƯỜI GIÀ	Mỗi thành viên khi tham gia sẽ đảm bảo duy trì tài khoản tối thiểu khi tham gia chương trình là 100.000 VNĐ/người.	\N
