5	Cộng đồng hỗ trợ hoạt động có hợp pháp?	Hoạt động của Cộng đồng hỗ trợ hoàn toàn không thuộc vào điều cấm của Pháp luật nước Cộng hoà xã hội chủ nghĩa Việt Nam. Mọi thông tin của Cộng đồng hỗ trợ đều sẽ được Công khai – minh bạch – An toàn và luôn tuân thủ theo quy định của Pháp luật.	2021-12-13 08:08:10	2021-12-20 11:31:38	\N
3	Làm thế nào để minh bạch được tiền đóng góp từ các thành viên và tiền Hỗ trợ?	Chúng tôi sử dụng công nghệ Blockchain để ghi nhận và truyền tải dữ liệu trong quá trình hoạt động do đó nguồn tiền được giám sát chặt chẽ, ghi nhận mọi giao dịch trong cộng đồng. Dữ liệu khi đã được đưa lên cộng đồng sẽ không có cách nào thay đổi được, chống việc gian lận và thay đổi dữ liệu của bất kỳ ai.	2021-12-13 08:07:51	2021-12-20 11:32:20	\N
2	Thành viên hỗ trợ, thành viên giám sát:	Thành viên hỗ trợ: Là thành viên của chương trình và tự nguyện hỗ trợ thành viên khác trong quá trình thu thập hồ sơ, giấy tờ và hoàn thiện thủ tục cần thiết để nhận được sự hỗ trợ từ cộng đồng. \nThành viên giám sát: Là thành viên của chương trình và được giao nhiệm vụ đi xác minh thông tin, kiểm tra, rà soát, đánh giá vụ việc để đề xuất cộng đồng có chấp nhận hỗ trợ hay không. Thành viên hỗ trợ và thành viên giám sát phải có tiêu chuẩn nhất định và được một số lượng nhất định thành viên cộng đồng bình chọn. Thành viên hỗ trợ và thành viên giám sát được nhận thù lao theo thoả thuận khi thực hiện công việc được giao.	2021-12-13 08:07:39	2021-12-20 11:32:41	\N
4	Chương trình hỗ trợ có bao nhiêu thành viên sẽ bắt đầu?	Chương trình hỗ trợ có bao nhiêu thành viên sẽ bắt đầu:\nMỗi chương trình chúng tôi đã có tính toán và số thành viên bắt đầu kích hoạt chương trình là khoảng 5.000 người trở lên cho một chương trình thấp nhất.	2021-12-13 08:08:01	2022-05-10 15:01:20	\N
1	Quyết định của Cộng đồng:	Khi có tranh chấp trong quá trình giải quyết Hồ sơ yêu cầu hỗ trợ thì sẽ có cuộc khảo sát lấy ý kiến từ các thành viên, kết quả khảo sát sẽ là kết quả cuối cùng để sử dụng giải quyết tranh chấp.\nCuối mỗi năm sẽ có báo cáo, tổng hợp công việc và định hướng phát triển tiếp theo để gửi đến các thành viên cộng đồng quyết định.\nNguyên tắc biểu quyết sẽ được quy định tuỳ từng thời điểm cụ thể.	2021-12-13 00:32:33	2022-05-10 15:04:50	\N
